import React from "react";

function Rating({ value, text, color }) {
  return (
    <div class Name="rating">
      <span>
        <i
          style={{ color }}
          className={
            value >= 5
              ? "fas fa-star"
              : value >= 4.5
                ? "fas fa-star-half-alt"
                : "far fa-star"
          }
        ></i>
      </span>
    </div>
  );
}

export default Rating;
